const ReachUs = () => {
    return (<div className='reachUs-content'>
    <div className='todos d2'>
    {/* <Brand className="logo" /> */}
      <h6>Colris Digital Private Ltd.</h6>
    </div>
    <div className='todos d2'>
    <h6>Colris Digital Private Ltd.</h6>
      <p>1049, Nesamani Nagar, Asaripallam road, Nagercoil.</p>
      <p>+91 7598 1531 59</p>

  </div>
  <div className='d4'/>
  <div className='d5'/>
  <div className='d6'/>
  <div className='d7'/>
</div>);
};

export default ReachUs;
